import React, { Component } from 'react';

class Nabvar extends Component {

  render() {
    return (
      <div>

        <div>
          <div> Home </div>
          <div> Category </div>
          <div> Budget </div>
          <div> Expense </div>
          <div> Week/Month </div>
          <div> Year </div>
        </div>

        <div>
          <div> Profile </div>
          <div> Category </div>
          <div> Budget </div>
          <div> Expense </div>
          <div> Week/Month </div>
          <div> Year </div>
        </div>

      </div>
    );
  }
}

export default Nabvar;
